import ExpenseItem from './components/ExpenseItem';

function ExpenseList(props) {
    return(
        <ExpenseItem title = {props.expenses[0].title} amount = {expenses[0].amount} date = {expenses[0].date}/>
    )
}
export default ExpenseList
